import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './AdminAuth.css';


const AdminDashboard = () => {
  const [password, setPassword] = useState('');
  const [message, setMessage] = useState('');
  const [loading, setLoading] = useState(false);
  const [students, setStudents] = useState([]);
  const navigate = useNavigate();

  const resetRequired = window.history.state && window.history.state.usr && window.history.state.usr.resetRequired;

  const handleChangePassword = async (e) => {
    e.preventDefault();
    if (!password) {
      setMessage('Please enter a new password.');
      return;
    }
    setLoading(true);
    setMessage('');
    try {
      setMessage('Password changed successfully!');
    } catch (err) {
      setMessage('Error changing password.');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    // fetch students for admin dashboard
    const fetchStudents = async () => {
      try {
        const res = await fetch('http://localhost:5000/api/admin/students');
        if (res.ok) {
          const data = await res.json();
          setStudents(data.students || []);
        } else {
          console.error('Failed to fetch students');
        }
      } catch (err) {
        console.error('Error fetching students', err);
      }
    };
    fetchStudents();
  }, []);

  const sendTemp = async (studentId) => {
    try {
      const res = await fetch('http://localhost:5000/api/admin/send-temp-password', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ studentId })
      });
      const data = await res.json();
      if (res.ok) {
        alert(data.message || 'Temporary password sent or logged.');
      } else {
        alert((data.message || 'Failed') + (data.detail ? ' - ' + data.detail : ''));
      }
    } catch (err) {
      console.error('Error sending temp password', err);
      alert('Server error.');
    }
  };

  return (
    <div className="auth-container">
      <div className="auth-card">
        <h2>Admin Dashboard</h2>
        {resetRequired ? (
          <form onSubmit={handleChangePassword} className="auth-form">
            <input
              type="password"
              placeholder="New Password"
              value={password}
              onChange={e => setPassword(e.target.value)}
            />
            {message && <div className="info">{message}</div>}
            <div className="auth-buttons">
              <button type="submit" disabled={loading}>
                {loading ? 'Changing...' : 'Change Password'}
              </button>
              <button type="button" className="secondary" onClick={() => navigate('/')}>Logout</button>
            </div>
          </form>
        ) : (
          <div>
            <p>Welcome to the admin dashboard!</p>
            <div style={{ marginTop: 12 }}>
              <h3>Students</h3>
              {students.length === 0 ? (
                <p>No students found.</p>
              ) : (
                <table style={{ width: '100%', borderCollapse: 'collapse' }}>
                  <thead>
                    <tr>
                      <th style={{ textAlign: 'left', padding: 6 }}>Student ID</th>
                      <th style={{ textAlign: 'left', padding: 6 }}>Name</th>
                      <th style={{ textAlign: 'left', padding: 6 }}>Email</th>
                      <th style={{ textAlign: 'left', padding: 6 }}>Phone</th>
                      <th style={{ textAlign: 'left', padding: 6 }}>Actions</th>
                    </tr>
                  </thead>
                  <tbody>
                    {students.map(s => (
                      <tr key={s._id}>
                        <td style={{ padding: 6 }}>{s.studentId}</td>
                        <td style={{ padding: 6 }}>{s.name}</td>
                        <td style={{ padding: 6 }}>{s.email}</td>
                        <td style={{ padding: 6 }}>{s.phone}</td>
                        <td style={{ padding: 6 }}>
                          <button onClick={() => sendTemp(s.studentId)}>Send Temp Password</button>
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              )}
            </div>
            <div style={{ marginTop: 12 }}>
              <button type="button" className="secondary" onClick={() => navigate('/')}>Logout</button>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default AdminDashboard;
